body.script:
Craft.elementIndex = Craft.createElementIndex('craft\\elements\\Asset', $('#main'), {
        context:        'index',
        storageKey:     'elementindex.craft\\elements\\Asset',
        criteria:       Craft.defaultIndexCriteria
    });
Craft.cp.setJobInfo([], false);

(function()
{
    var trigger = new Craft.ElementActionTrigger({
        type: "craft\\elements\\actions\\PreviewAsset",
        batch: false,
        validateSelection: function($selectedItems)
        {
            var $element = $selectedItems.find('.element');

            return $element.length === 1;
        },
        activate: function($selectedItems)
        {
            var settings = {};
            if ($selectedItems.find('.element').data('image-width')) {
                settings.startingWidth = $selectedItems.find('.element').data('image-width');
                settings.startingHeight = $selectedItems.find('.element').data('image-height');
            }
            var modal = new Craft.PreviewFileModal($selectedItems.find('.element').data('id'), $selectedItems, settings);
        }
    });
})();
(function()
{
    var trigger = new Craft.ElementActionTrigger({
        type: "craft\\elements\\actions\\DownloadAssetFile",
        batch: false,
        activate: function($selectedItems)
        {
            var form = $('' +
            '' +
            '' +
            '' +
            '' +
            '');

            form.appendTo('body');
            form.submit();
            form.remove();
        }
    });
})();
(function()
{
    var trigger = new Craft.ElementActionTrigger({
        type: "craft\\elements\\actions\\Edit",
        batch: false,
        validateSelection: function($selectedItems)
        {
            return Garnish.hasAttr($selectedItems.find('.element'), 'data-editable');
        },
        activate: function($selectedItems)
        {
            var $element = $selectedItems.find('.element:first');

            if (Craft.elementIndex.viewMode === 'table') {
                Craft.createElementEditor($element.data('type'), $element, {
                    params: {
                        includeTableAttributesForSource: Craft.elementIndex.sourceKey
                    },
                    onSaveElement: $.proxy(function(response) {
                        if (response.tableAttributes) {
                            Craft.elementIndex.view._updateTableAttributes($element, response.tableAttributes);
                        }
                    }, this)
                });
            } else {
                Craft.createElementEditor($element.data('type'), $element);
            }
        }
    });
})();
(function()
{
    var trigger = new Craft.ElementActionTrigger({
        type: "craft\\elements\\actions\\RenameFile",
        batch: false,
        activate: function($selectedItems)
        {
            var $element = $selectedItems.find('.element'),
                assetId = $element.data('id'),
                oldName = $element.data('url').split('/').pop();

            if (oldName.indexOf('?') !== -1)
            {
                oldName = oldName.split('?').shift();
            }

            var newName = prompt("Enter the new filename", oldName);

            if (!newName || newName == oldName)
            {
                return;
            }

            Craft.elementIndex.setIndexBusy();

            var sourcePath = Craft.elementIndex.$source.data('key').split('/');
            var assetSourceKey = sourcePath.pop();
            var data = {
                assetId:   assetId,
                folderId: assetSourceKey.split(':')[1],
                filename: newName
            };

            var handleRename = function(response, textStatus)
            {
                Craft.elementIndex.setIndexAvailable();

                if (textStatus === 'success')
                {
                    if (response.conflict)
                    {
                        alert(response.conflict);
                        this.activate($selectedItems);
                        return;
                    }

                    if (response.success)
                    {
                        Craft.elementIndex.updateElements();

                        // If assets were just merged we should get the reference tags updated right away
                        Craft.cp.runQueue();
                    }

                    if (response.error)
                    {
                        alert(response.error);
                    }
                }
            }.bind(this);

            Craft.postActionRequest('assets/move-asset', data, handleRename);
        }
    });
})();
(function()
{
    var trigger = new Craft.ElementActionTrigger({
        type: "craft\\elements\\actions\\ReplaceFile",
        batch: false,
        activate: function($selectedItems)
        {
            $('.replaceFile').remove();

            var $element = $selectedItems.find('.element'),
                $fileInput = $('').appendTo(Garnish.$bod),
                options = Craft.elementIndex._currentUploaderSettings;

            options.url = Craft.getActionUrl('assets/replace-file');
            options.dropZone = null;
            options.fileInput = $fileInput;
            options.paramName = 'replaceFile';

            var tempUploader = new Craft.Uploader($fileInput, options);
            tempUploader.setParams({
                assetId: $element.data('id')
            });

            $fileInput.click();
        }
    });
})();
(function()
{
    var trigger = new Craft.ElementActionTrigger({
        type: "craft\\elements\\actions\\CopyReferenceTag",
        batch: false,
        activate: function($selectedItems)
        {
            var message = Craft.t('app', "{ctrl}C to copy.", {
                ctrl: (navigator.appVersion.indexOf('Mac') !== -1 ? '⌘' : 'Ctrl-')
            });

            prompt(message, '{'+"asset"+':'+$selectedItems.find('.element').data('id')+'}');
        }
    });
})();
(function()
{
    var trigger = new Craft.ElementActionTrigger({
        type: "craft\\elements\\actions\\EditImage",
        batch: false,
        _imageEditor: null,
        validateSelection: function($selectedItems)
        {
            return Garnish.hasAttr($selectedItems.find('.element'), 'data-editable-image');
        },
        activate: function($selectedItems)
        {
            var $element = $selectedItems.find('.element:first'),
                element = Craft.getElementInfo($element);

            var settings = {
                onSave: function () {
                    Craft.elementIndex.updateElements();
                },
                allowDegreeFractions: Craft.isImagick,
            };

            new Craft.AssetImageEditor(element.id, settings);
        }
    });
})();
